                        <div style={{ height: "350px", overflow: "auto", fontSize: '0.8vw', }}>
                            <table style={{ width: "100%", tableLayout: "fixed" }}>
                            <thead>
                                <tr>
                                <th style={{ color: "#e8e8e8", width: "25%", padding: "10px" }}>Soil Depth:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", padding: "10px" }}>Soil Moisture:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", padding: "10px" }}>Soil Temperature:</th>
                                <th style={{ color: "#e8e8e8", width: "25%", padding: "10px" }}>Electrical Conductivity:</th>
                                </tr>
                            </thead>
                            <tbody>
                                <tr>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4"}}>6"</td>
                                <td style={{ borderBottom: "1px solid #d3d3d3", padding: "10px", textAlign: "center", borderBottomWidth: "1px", width: "25%", color: "#00e1b4" }}>44.94%</td>
